import React from "react";
import "../AppTitle/AppTitle.css";
import App from "../../App";

const AppTitle = () => {
  return (
    <div>
      <div
        className="typing"
        style={{ animationDelay: "0s", animationDuration: "2s" }}
      >
        <h1> Welcome to</h1>
      </div>
      <div
        className="typing"
        style={{ animationDelay: "2s", animationDuration: "3s" }}
      >
        <h1> TerraSomething...</h1>
      </div>
    </div>
  );
};

export default AppTitle;
